// SPDX-License-Identifier: MIT
pragma solidity ^0.8.11;


//_____________________________________________________________________________________________________
// PLANIRAM DA NAPRAVIM SVE ISTE FAJLOVE KAO STO IMAM U JS PROGRAMU, SVAKI CE BITI LIBRARY ILI CONTRACT I KORISTICE GA MOJ GLAVNI CONTRACT, MOZDA MOGU DA ODVOJIM JOS NEKE STVARI U UTILS CONTRACT (VIDECU, ALI NIJE TO ONO STO JE BITNO SAD)
// TREBAM DA SKONTAM KAKO SE GENERISE RANDOM BROJ, AKO JE TO UOPSTE MOGUCE NA BLOCKCHAINU (A BILO BI MI VEOMA BITNO DA BUDE MOGUCE, JER NE ZNAM KAKO BIH INACE GENERISAO RANDOM GRADOVE)
//_____________________________________________________________________________________________________

contract BuildingStats {
    uint mapDimensions = 20;

    struct Building {
        BuildingTypes buildingType;
        uint32 startx;
        uint32 starty;
        uint32 endx;
        uint32 endy;
        uint32 level;
    } // occupies 1 block of 256 bytes

    struct City {
        mapping(uint => Building) buildingList;
        uint128 numOfBuildings;
        uint128 money;
        uint128 income;
        address owner;
    } // occupies ( 2 + buildingList.size ) blocks of 256 bytes in total
    

    // These are the types of buildings that exist:
    enum BuildingTypes {
        Factory,
        Office,
        Restaurant,
        Parking,
        Building,
        House,
        Store,
        SuperMarket,
        Park,
        Gym
    }
    //______________________________________________

    mapping(BuildingTypes => uint[2][]) buildingDimensions; // map with the possible dimensions of a building
    bool buildingDimensionsInitialized = false; // this is done so that the init function can't be called multiple times and use a lot of unnecessary gas

    function initBuildingDimensions() private {
        require(buildingDimensionsInitialized == false, 'Building Dimensions are already initialized');
        buildingDimensionsInitialized = true;

        buildingDimensions[BuildingTypes.Factory].push([2, 4]);
        buildingDimensions[BuildingTypes.Factory].push([4, 2]);

        buildingDimensions[BuildingTypes.Office].push([2, 2]);
        
        buildingDimensions[BuildingTypes.Restaurant].push([2, 1]);
        buildingDimensions[BuildingTypes.Restaurant].push([1, 2]);

        buildingDimensions[BuildingTypes.Parking].push([2, 2]);
        buildingDimensions[BuildingTypes.Parking].push([3, 2]);
        buildingDimensions[BuildingTypes.Parking].push([4, 2]);
        buildingDimensions[BuildingTypes.Parking].push([2, 3]);
        buildingDimensions[BuildingTypes.Parking].push([3, 3]);
        buildingDimensions[BuildingTypes.Parking].push([4, 3]);
        buildingDimensions[BuildingTypes.Parking].push([2, 4]);
        buildingDimensions[BuildingTypes.Parking].push([3, 4]);
        buildingDimensions[BuildingTypes.Parking].push([4, 4]);

        buildingDimensions[BuildingTypes.Building].push([1, 3]);
        buildingDimensions[BuildingTypes.Building].push([3, 1]);
        buildingDimensions[BuildingTypes.Building].push([2, 2]);

        buildingDimensions[BuildingTypes.House].push([1, 1]);

        buildingDimensions[BuildingTypes.Store].push([1, 1]);
        
        buildingDimensions[BuildingTypes.SuperMarket].push([2, 2]);

        buildingDimensions[BuildingTypes.Park].push([2, 2]);
        buildingDimensions[BuildingTypes.Park].push([3, 2]);
        buildingDimensions[BuildingTypes.Park].push([4, 2]);
        buildingDimensions[BuildingTypes.Park].push([5, 2]);
        buildingDimensions[BuildingTypes.Park].push([2, 3]);
        buildingDimensions[BuildingTypes.Park].push([3, 3]);
        buildingDimensions[BuildingTypes.Park].push([4, 3]);
        buildingDimensions[BuildingTypes.Park].push([5, 3]);
        buildingDimensions[BuildingTypes.Park].push([2, 4]);
        buildingDimensions[BuildingTypes.Park].push([3, 4]);
        buildingDimensions[BuildingTypes.Park].push([4, 4]);
        buildingDimensions[BuildingTypes.Park].push([5, 4]);
        buildingDimensions[BuildingTypes.Park].push([2, 5]);
        buildingDimensions[BuildingTypes.Park].push([3, 5]);
        buildingDimensions[BuildingTypes.Park].push([4, 5]);
        buildingDimensions[BuildingTypes.Park].push([5, 5]);

        buildingDimensions[BuildingTypes.Gym].push([2, 2]);
    }

    struct Stats {
        uint32 cost; 
        uint16 normalPeople;
        uint16 educatedPeople; 
        uint16 manualWorkers; 
        uint16 officeWorkers;
    } // struct holds the information about one level of a building
    struct Levels {
        uint maxLevel;
        Stats[] levels;
    } // struct holds the information about all levels of a building and the max level

    mapping(BuildingTypes => Levels) buildingStats; // map with the infomation about all possible buildings and their levels
    bool buildingStatsInitialized = false; // this is done so that the init function can't be called multiple times an use a lot of unnecessary gas

    function initBuildingStats() private {
        require(buildingStatsInitialized == false, 'The stats have already been initialized');
        buildingStatsInitialized = true;

        buildingStats[BuildingTypes.Factory].levels.push(Stats({ cost: 2000000, normalPeople: 0, educatedPeople: 0, manualWorkers: 50, officeWorkers: 15 }));
        buildingStats[BuildingTypes.Factory].levels.push(Stats({ cost: 2000000, normalPeople: 0, educatedPeople: 0, manualWorkers: 70, officeWorkers: 30 }));
        
        buildingStats[BuildingTypes.Office].levels.push(Stats({ cost: 1500000, normalPeople: 0, educatedPeople: 0, manualWorkers: 0, officeWorkers: 25 }));
        buildingStats[BuildingTypes.Office].levels.push(Stats({ cost: 1500000, normalPeople: 0, educatedPeople: 0, manualWorkers: 0, officeWorkers: 40 }));

        buildingStats[BuildingTypes.Restaurant].levels.push(Stats({ cost: 500000, normalPeople: 0, educatedPeople: 0, manualWorkers: 20, officeWorkers: 5 }));

        buildingStats[BuildingTypes.Parking].levels.push(Stats({ cost: 50000, normalPeople: 0, educatedPeople: 0, manualWorkers: 0, officeWorkers: 0 }));

        buildingStats[BuildingTypes.Building].levels.push(Stats({ cost: 40000, normalPeople: 8, educatedPeople: 2, manualWorkers: 0, officeWorkers: 0 }));
        buildingStats[BuildingTypes.Building].levels.push(Stats({ cost: 40000, normalPeople: 20, educatedPeople: 5, manualWorkers: 0, officeWorkers: 0 }));

        buildingStats[BuildingTypes.House].levels.push(Stats({ cost: 200000, normalPeople: 2, educatedPeople: 3, manualWorkers: 0, officeWorkers: 0}));
        buildingStats[BuildingTypes.House].levels.push(Stats({ cost: 200000, normalPeople: 4, educatedPeople: 7, manualWorkers: 0, officeWorkers: 0}));

        buildingStats[BuildingTypes.Store].levels.push(Stats({ cost: 100000, normalPeople: 0, educatedPeople: 0, manualWorkers: 10, officeWorkers: 0 }));

        buildingStats[BuildingTypes.SuperMarket].levels.push(Stats({ cost: 300000, normalPeople: 0, educatedPeople: 0, manualWorkers: 30, officeWorkers: 10 }));

        buildingStats[BuildingTypes.Park].levels.push(Stats({ cost: 300000, normalPeople: 0, educatedPeople: 0, manualWorkers: 30, officeWorkers: 10 }));

        buildingStats[BuildingTypes.Gym].levels.push(Stats({ cost: 400000, normalPeople: 0, educatedPeople: 0, manualWorkers: 10, officeWorkers: 0 }));
    } // function used for initializing the values of the stats

    // used for inizializing values in the conract
    constructor() {
        initBuildingDimensions();
        initBuildingStats();
    }
}
